import React from "react";
import Animals from "../Components/Animals";

function MobileMenu({ active }) {
    return (
        <div className={`mobileMenu ${active ? 'active' : ''}`}>
            <div>
                <Animals/>
            </div>
        </div>
    );
}

export default MobileMenu;
